          className="cursor-pointer px-2 py-1"
        >
          3
        </span>
        <span 
          onClick={() => setCurrentPage(4)} 
          className="cursor-pointer px-2 py-1"
        >
          4
        </span>
        <span 
          onClick={() => setCurrentPage(5)} 
          className="cursor-pointer px-2 py-1"
        >
          5
        </span>
      </>
    );
  };
  
  export default PaginationNumbers;
